    [],nt"revision_timestamp": "2016-03-02T22:37:35.280451",nt"name": "enviroatlas-des-moines-ia-one-meter-resolution-urban-land-cover-data-2010-web-service",nt"isopen":
    false,nt"url": null,nt"notes": "This EnviroAtlas web service supports research
    and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas
    ). The Des Moines, IA EnviroAtlas Meter-scale Urban Land Cover Data were generated
    from the High Resolution Land Cover (HRLC) product created by the Iowa Department
    of Natural Resources (IDNR), consisting of data for Dallas, Polk, and Warren counties.
    The 14 class IDNR land cover product was modified to fit the land cover classification
    structure of the EPA EnviroAtlas resulting in six land cover classes mapped: water,
    impervious surfaces, soil and barren land, trees and forest, grass and herbaceous
    non-woody vegetation, and agriculture. An accuracy assessment of 600 completely
    random and 90 stratified random points yielded an overall User's fuzzy accuracy
    of 78 or 85 percent (more and less conservative fuzzy estimates, respectively).
    The area mapped is defined by the US Census Bureau's 2010 Urban Statistical Area
    for Des Moines, IA plus a 1 km buffer. Additional areas outside the 1 km boundary
    were also mapped but not included in the accuracy assessment. We expect the accuracy
    of the areas outside of the 1 km boundary to be consistent with those within. These
    data were produced by the US EPA to support research and online mapping activities
    related to the EnviroAtlas (https://www.epa.gov/enviroatlas ) which allows the user
    to interact with a web-based, easy-to-use, mapping application to view and analyze
    multiple ecosystem services for the contiguous United States. The dataset is available
    as downloadable data (https://edg.epa.gov/data/PUBLIC/ORD/ENVIROATLAS ) or as an
    EnviroAtlas map service. Additional descriptive information about each attribute
    in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets
    ).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
